update c
set c.cli_usu_fk= u.usu_id, c.cli_rol_fk = r.rol_id
from cliente c
join Usuario u on u.usu_correo = c.cli_email
join Rol r on r.rol_nombre  = 'Cliente'

update p 
set p.pro_usu_fk = u.usu_id , p.pro_rol_fk = r.rol_id
from Proveedor p
join Usuario u on u.usu_correo = p.pro_email
join Rol r on r.rol_nombre  = 'Proveedor'